import styled, { createGlobalStyle } from 'styled-components'


export const GlobalStyle = createGlobalStyle `
body {
    margin: 0;
    padding: 0; 
    box-sizing: border-box;
}

a {
    text-decoration: none;
}

.wrap {
    display: flex;
    flex-wrap: wrap;
}

.wrap > div {
    padding: 20px;
}

.header {
    display: flex;
    border-bottom: 1px solid #ddd;
    padding: 20px;
    flex: 0 0 100%;
}

.header a {
    color: black;
    font-weight: bold;
    display: inline-block;
    margin-right:30px;
}

.login-view {
    border: 1px solid #ddd;
    padding:0 !important;
}
.card {
    display:flex;
    background: #f6f6f6;
    padding:15px;
}


.posts-cards {
    display: flex;
}

.posts-cards > div {
    flex: 1;
    border: 1px solid #ddd;
}
`

export const ActiveBtn = styled.button `
    background: #3b68db;
    border: none;
    padding: 10px 15px;
    color: #fff;
    border-radius: 2px;
`

export const Button = styled.button `
    background: #fff;
    border: 1px solid #ddd;
    padding: 10px 20px;
    border-radius: 2px;
`
